[General]
cmdenv-interactive = true
sim-time-limit = 90s

#*.client.addPacketDropper = true
#*.client.packetDropper.packetNumber = 13699
#*.client.packetDropper.packetNumber = 3424

seed-set=${0,1,2,3,4}
**.numIMU=1
**.priority=5
**.pcapRecorder[*].alwaysFlush = true
*.client.numPcapRecorders = 1
*.client.pcapRecorder[*].pcapLinkType = 1		# ethernet
*.client.pcapRecorder[*].pcapFile = "results/ethclient.pcap"
*.server.numPcapRecorders = 1
*.server.pcapRecorder[*].pcapLinkType = 1		# ethernet
*.server.pcapRecorder[*].pcapFile = "results/ethserver.pcap"
**.crcMode = "computed"
**.fcsMode = "computed"
**.tcp.mss = 1460
**.tcp.tcpAlgorithmClass = "TcpNewRenoLinux" #"TcpNewReno"
**.tcp.increasedIWEnabled = true
**.tcp.windowScalingSupport = true #To increase advWndw above 65kB
**.tcp.windowScalingFactor = 3
#**.tcp.sackSupport = true #Supported only for TcpReno
**.tcp.delayedAcksEnabled = true
**.tcp.nagleEnabled= false
*.client.tcp.advertisedWindow = 65507 # Window on RoS side
*.client.app[*].io.connectAddress = "server"
#*.server.addInterPackDelay = true
*.server.tcp.advertisedWindow = 65535 # Window on LV side
#*.client.eth[*].mac.mtu = 1500B
#*.client.eth[*].mac.queue.packetCapacity = 334
*.client.packDelayer.delay = 2us#truncnormal(1us,5us)#2us was the median in measurement of pcap file (TCP time between same streams in segments)
*.client.addInterPackDelay = false
*.server.packDelayer.delay = 1us#1us
*.server.addInterPackDelay = false

# result files
output-vector-file = ${resultdir}/MRGen_CAN_stream${seedset}.vec
output-scalar-file = ${resultdir}/MRGen_CAN_stream${seedset}.sca


